import { Component } from '@angular/core';
import { Recipe } from 'src/app/models/recipres.model';

@Component({
  selector: 'app-recipe-list',
  templateUrl: './recipe-list.component.html',
  styleUrls: ['./recipe-list.component.css']
})
export class RecipeListComponent {
  recipes : Recipe[] = [
    new Recipe('a test recipe','this is a test','https://www.google.com/imgres?imgurl=https%3A%2F%2Frealfood.tesco.com%2Fmedia%2Fimages%2F1400x919-HuntersChicken-1cddb648-ead8-4325-8e60-f80d1ca4ede3-0-1400x919.jpg&tbnid=xXp6aqYvTPtUxM&vet=12ahUKEwi4jIub_ZaBAxXlmicCHf5rCtwQMygQegQIARB2..i&imgrefurl=https%3A%2F%2Frealfood.tesco.com%2Frecipes%2Fhunters-chicken.html&docid=yBNHPgFB5-pohM&w=1400&h=919&q=recipe&ved=2ahUKEwi4jIub_ZaBAxXlmicCHf5rCtwQMygQegQIARB2')
  ];

}
